  private String name;
  private int age;
  private String status;
  public NewData() {
	// TODO Auto-generated constructor stub
      }
public int getId() {
	return id;
}
public void setId(int id) {
	this.id = id;
}
public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}
